    def make(self):
        project = self.plainTextEdit_2.toPlainText()
        with open(f'Ques/Azmoon/{self.name}.tm','w') as tm:
            tm.write(project)
        with open('Uper/List Azmax.txt','a') as lamax:
            lamax.write(f'{self.name}*%!')
    def opentomutc(self):
        code = self.plainTextEdit.toPlainText()
        from MUTC import Ui_Dialog
        ad = Ui_Dialog()
        adi = QtWidgets.QDialog()
        ad.setupUi(adi)
        ad.textEdit.setText(code)
        adi.exec_()
    def trrig(self):
            try:
                mutcb = []
                adr = setAdrFile[0]
                if '\\' in adr:
                    adr = list(adr.split('\\'))
                elif '/' in adr:
                    adr = list(adr.split('/'))
                end1 = adr[-1]
                end = end1[:-3]
                self.name = end
                adr = '\\'.join(adr)
                print(adr)
                with open(adr) as ad:
                    self.adred = ad.read()
                self.plainTextEdit_2.setPlainText(self.adred)
        
                self.lineEdit.setText(end)
                if '**\n' not in self.adred:
                    from Out import Ui_Dialog
                    ding = Ui_Dialog()
                    diadi = QtWidgets.QDialog()
                    ding.setupUi(diadi)
                    ding.label.setText(f"Erorr:no format in the baseD")
                    ding.pushButton.clicked.connect(lambda : diadi.close())
                    diadi.exec_()
                    self.pushButton.setEnabled(False)
                    self.pushButton_2.setEnabled(False)
                    self.pushButton_3.setEnabled(False)
                    return
                adred = list(self.adred.split('**\n'))
                
                self.lineEdit_2.setText(adred[0])
                if adred[0] not in('Test','Anatomical','Guessy'):
                    from Out import Ui_Dialog
                    ding = Ui_Dialog()
                    diadi = QtWidgets.QDialog()
                    ding.setupUi(diadi)
                    ding.label.setText(f"Erorr:type is lost")
                    ding.pushButton.clicked.connect(lambda : diadi.close())
                    diadi.exec_()
                    self.pushButton.setEnabled(False)
                    self.pushButton_2.setEnabled(False)
                    self.pushButton_3.setEnabled(False)
                    return
                lines = len(adred)
                self.lineEdit_3.setText(str(lines))
                mutcb.append(f'#Name:{end}')
                mutcb.append(f'#Type:{adred[0]}')
                mutcb.append('')
                th = 1
                b = 0
                for i in adred:
                    if i not in ('Test','Anatomical','Guessy',']#%>>'):
                        if b == 0:
                            mutcb.append(f'{th}.')
                            mutcb.append(f'#Scorr:{i}')
                            
                        if b == 1:
                            mutcb.append(f'#Que:{i}')
                        if b == 2:
                            mutcb.append(f'#Blad:{i}')
                        if b == 3:
                            mutcb.append(f'#Img:{i}')
                            mutcb.append(f'#Next:')
                            mutcb.append('')
                        print(b)
                        b += 1
                        
                        print(i,'@@@@@@@@!@!')
                    if i == ']#%>>':
                        
                        b = 0
                        th += 1
                mutcb.append('#Run:')
                code = ';\n'.join(mutcb)
                self.plainTextEdit.setPlainText(code)
                
            except:      
                from Out import Ui_Dialog
                ding = Ui_Dialog()
                diadi = QtWidgets.QDialog()
                ding.setupUi(diadi)
                ding.label.setText(f"Erorr:no file in dirctry")
                ding.pushButton.clicked.connect(lambda : diadi.close())
                diadi.exec_()
                self.pushButton.setEnabled(False)
                self.pushButton_2.setEnabled(False)
                self.pushButton_3.setEnabled(False)
                
            
        

